import React, { Component } from 'react'
import { theUrl } from 'selfConfig'
import { connect } from 'react-redux'
import { Link } from 'react-router-dom'
import { Modal } from 'antd';


class App extends Component {
  constructor(props) {
    super(props)
    this.getList = this.getList.bind(this)
    this.delAdmin = this.delAdmin.bind(this)

    this.state = {
        url: theUrl + '/adminList',
        columns: [{
            title: 'ID',
            dataIndex: 'id',
            key: 'id',
          }, {
            title: 'Username',
            dataIndex: 'username',
            key: 'username',
          }, {
            title: 'Phone',
            dataIndex: 'phone',
            key: 'phone',
        }, {
            title: 'Action',
            key: 'action',
            render: (text, record) => (
                <Popconfirm title="Sure to delete?" onConfirm={() => this.delAdmin(record.id)}>
                    <a href="javascript:;">Delete</a>
                </Popconfirm>
            ),
        }],
    }
  }
  componentDidMount() {
      this.getList(this.state.url)
  }   

  getList = (getAdminList) => {

      fetch(getAdminList, {
          headers: tokenHeaders(localStorage.getItem("token")),
          method: 'get',
      })
      .then(res => { return res.json() })
      .then(res => {
          this.props.init(res)
          // Debugging
          // console.log(res)
      })
      .catch(e=> {
          console.log("token expired")

      })
  }

  delAdmin = (key) => {
      this.props.deleteAdmin(key)
  }

  render() {
    return(
      <div>
        <div>
          <h1>Hello react</h1>
          <Link to="/user_profile">To user profile  || </Link>
          <Link to="/root_dashboard">To root dashboard  || </Link>
          <Link to="/admin_dashboard">To admin dashboard || </Link>
          <Link to="/signup">Sign up</Link>
        </div>

        <div>

        </div>
      </div>
    )
  }
}

const mapStateToProps = state => ({
  list: state.list
})

const mapDispatchToProps = dispatch => ({
  init: res => dispatch({
    type: 'INIT',
    res
  })
})

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(App);
